import "./VcanciesItem.css"
import moment from "moment";


const VacanciesItem =({vac,department,vacancies,description})=> {
    console.log('vac=',vac)
    const date = moment().format('YYYY-MM-DD');

    return (
        <>
            <div>
                <div>{department}</div>
                {vacancies.map(vac => (
                    <div key={vac.id}>
                        <div>{date === vac.create_date ? 'NEW' : ''}</div>
                        <li className='VacationsContainer'>{vac.name}{moment(vac.create_date).format('DD.MM.YYYY')}{vac.user_name}</li>
                        <div>{vac.description}</div>
                    </div>
                ))}
            </div>
        </>
    )
}

export default VacanciesItem
